import {
    fetchCompForm,
    clearCompForm,
    makeOrderRequestAC,
} from './actions'

const makeOrderRequest = (form) => (dispatch, getState) => {
    const data = {
        alias: getState().compOrderForm.alias,
        ...form
    }

    // console.log()
    dispatch(makeOrderRequestAC(data)).then(res => {
        console.log(res)
    })

}

export {
    fetchCompForm,
    clearCompForm,
    makeOrderRequest
}
